records.addlTxt:
Defendant Grant A Bunchkowski in court with attorney J Anthony Rosario.  Shawn N Woller appeared for the State of Wisconsin.
Defendant entered a no contest Alford plea to count 1 with the repeater allegation stricken.
Court conducted plea colloquy with defendant.
Court struck the repeater allegation in count 1 and found the defendant guilty of count 1. Count 2 dismissed and read-in.

The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

36 MONTHS IMPRISONMENT (CREDIT - 123 days)
  -  18 YEAR(S) OF INITIAL CONFINEMENT
  -  18 YEAR(S) OF EXTENDED SUPERVISION;

TERM OF PROBATION:  3  YEARS;

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety; Random UA's 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions;
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain employment and/or combination of schooling ;
*No contact with:  the victim, K.L., or her residence;
*DNA sample to be provided if not yet previously done.
*Domestic Violence Counseling and Anger Management or a combination of both; 
*Complete a Cognitive Thinking Course.
*Maintain driver license and no operation of a motor vehicle without a valid license;

COURT COSTS:  $368.00 (includes $100.00 DV surcharge to be paid at a rate of $50.00 per month commencing October 1, 2015 and each month thereafter, to be paid as a condition of probation;

DNA SURCHARGE:  $250.00 to beincluded in payment plan listed above and paid as a condition of probation;

IF REVOKED:
Defendant is eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
